import { useEffect, useState } from "react";
import Axios from "../axios.js";

const Form = () => {
  const [workouts, setWorkout] = useState([]);

  useEffect(() => {
    const fetchAllWorkout = async () => {
      try {
        const res = await Axios.get("http://localhost:3001/api");
        setWorkout(res.data);
      } catch (err) {
        console.log(err);
      }
    };
    fetchAllWorkout();
  }, []);

  return (
    <div>
      {workouts.map((name) => (
        <li>{name}</li>
      ))}
    </div>
  );
};

export default Form;
